[package]
name = "plaid"
edition = "2021"
version = "1.0.0"
description = "Plaid client, generated from the OpenAPI spec."
homepage = "https://github.com/libninjacom/plaid-rs"
documentation = "https://docs.rs/plaid"
readme = "README.md"
license = "MIT"
repository = "https://github.com/libninjacom/plaid-rs"

[workspace]
members = []

[dependencies]
futures = "0.3.25"
serde_json = "1.0.81"

[dependencies.chrono]
version = "0.4.23"
features = ["serde"]

[dependencies.httpclient]
version = "0.15.0"
features = []
default-features = false

[dependencies.serde]
version = "1.0.137"
features = ["derive"]

[dev-dependencies.tokio]
version = "1.18.2"
features = ["full"]

[lib]
path = "src/lib.rs"
name = "plaid"
doctest = false
edition = "2021"
crate-type = ["rlib"]
required-features = []

